"""plot a single spec"""

def plot_single_mm(set_values, image_label = "2b", exp_time = "45", linelist_path = '', y_shift = 0):
	for i in range(int(len(set_values)/3)):
		plotting_data = set_values[3*i:3*i+3]
		label	 = plotting_data[0].strip(" []#")
		px		= plotting_data[1]
		int_vals  = plotting_data[2]
		px = np.array(px)
		int_vals = np.array(int_vals)

		if image_label in label and exp_time in label:
				px = [i/(2400/25.4) for i in px] # plot to match ASPAS
				plt.plot(px, int_vals + y_shift, alpha = 0.5, label = label)

		if linelist_path == '': pass
		else:
			file_data = [i.strip("\n") for i in open(linelist_path)][3:]
			file_data = [[float(i[:11]), float(i[11:11+12]), i[11+12:].strip(" ")] for i in file_data]
			for line in file_data:
				if line[2] == 'pB': linestyle = ":"
				elif line[2] == '': linestyle = ":"
				else: linestyle = "--"

				wl_mm = line[0]

				plt.plot([wl_mm, wl_mm], [0 + y_shift,line[1] + y_shift], alpha = 0.5, color = "r", linestyle = linestyle)


def plot_single_AA(set_values, image_label = "2b", exp_time = "45", linelist_path = '', y_shift = 0, linec = "g", specc = "g"):
	wls_to_match = [] ; all_wls= []
	for i in range(int(len(set_values)/3)):
		plotting_data = set_values[3*i:3*i+3]
		label	 = plotting_data[0].strip(" []#")
		px		= plotting_data[1]
		int_vals  = plotting_data[2]
		px = np.array(px)
		int_vals = np.array(int_vals)

		if image_label in label and exp_time in label:

			if "1a" in label:
				px = [(i * 0.00821) + 525 for i in px] #plot to get on AA scale
				coeff_b = 525
			elif "1b" in label:
				px = [(i * 0.00821) + 525 + 118 for i in px] #plot to get on AA scale
				coeff_b = 525 + 118
			elif "2a" in label:
				px = [(i * 0.00821) + 882 for i in px] #plot to get on AA scale
				coeff_b = 882
				if exp_time == "05":
					px = [i- 0.12 for i in px]
			elif "2b" in label:
				px = [(i * 0.00821) + 1001.8 for i in px] #plot to get on AA scale
				coeff_b =  1001.8
			plt.plot(px, int_vals + y_shift, alpha = 0.5, label = label, color = specc)

	if linelist_path == '': pass
	else:
		file_data = [i.strip("\n") for i in open(linelist_path)][3:]
		file_data = [[float(i[:11]), float(i[11:11+12]), i[11+12:].strip(" ")] for i in file_data]
		for line in file_data:
			plot=False
			if line[2] == 'pB': linestyle = "--" ; plot=True
			elif line[2] == '': linestyle = "--" ; plot=True
			else: linestyle = ":"

			wl_mm = line[0] * (2400/25.4)
			wl_mm = (wl_mm * 0.00821) + coeff_b  #plot to get on AA scale

			if plot == True:
				wls_to_match.append([line[0], wl_mm])
				#print(line[0], ", ", wl_mm, ",")
				plt.plot([wl_mm, wl_mm], [0 + y_shift,line[1] + y_shift], alpha = 0.3, color = linec, linestyle = linestyle)
			all_wls.append([line[0], wl_mm])

	plt.xlabel("mm (?)")
	return all_wls, wls_to_match



def gaussian(x, amp, cen, wid):
    return amp * np.exp(-(x-cen)**2 / wid)
    
    
def plot_spec_autofit(set_values, image_label = "2b", exp_time = "45", linec = "g", specc = "g"):
	wls_to_match = [] ; all_wls= []
	for i in range(int(len(set_values)/3)):
		plotting_data = set_values[3*i:3*i+3]
		label	 = plotting_data[0].strip(" []#")
		px		= plotting_data[1]
		int_vals  = plotting_data[2]
		px = np.array(px)
		int_vals = np.array(int_vals)

		if image_label in label and exp_time in label:

			spec_resolution = 0.001
			# Extrapolated values aren't used. Only necessary for plotting.
			self_intensity = interp1d(px, int_vals, kind='cubic', fill_value='extrapolate')
			# ~ px_all = np.arange(0, max(px), 0.001)
			px_all = np.arange(0, max(int_vals), spec_resolution)
			self_estimated_peaks_int, _ = find_peaks(self_intensity(px_all), prominence=(7, None))
			self_estimated_peaks_xval = px_all[np.array(self_estimated_peaks_int)]
			
			# ~ plt.plot(px, int_vals, alpha = 0.5, label = label, color = specc)
			plt.plot(px_all, self_intensity(px_all), alpha = 0.5, label = "interpolate " + label)


			for est_peak_xval in self_estimated_peaks_xval:
				plt.plot(est_peak_xval, self_intensity(est_peak_xval), color="r", marker = "x")
				
				extend_lim = 3
				mir_plot_x = np.arange(est_peak_xval-extend_lim, est_peak_xval+extend_lim + spec_resolution,  spec_resolution)
				plt.plot(mir_plot_x[::], self_intensity(mir_plot_x), color="r", marker = "")
				plt.plot(mir_plot_x[::-1], self_intensity(mir_plot_x), color="g", marker = "")

				# ~ plt.plot([i- 0.1 for i in mir_plot_x[::-1]], self_intensity(mir_plot_x), color="y", marker = "")
				# ~ plt.plot([i- 0.2 for i in mir_plot_x[::-1]], self_intensity(mir_plot_x), color="orange", marker = "")
				# ~ plt.plot([i- 0.3 for i in mir_plot_x[::-1]], self_intensity(mir_plot_x), color="violet", marker = "")
				# ~ plt.plot([i- 0.4 for i in mir_plot_x[::-1]], self_intensity(mir_plot_x), color="silver", marker = "")




				x = mir_plot_x[::]
				y = self_intensity(mir_plot_x)
				init_vals = [max(y), est_peak_xval, 6]  # for [amp, cen, wid]
				best_vals, covar = curve_fit(gaussian, x, y, p0=init_vals)
				# ~ plt.plot(x, gaussian(x, *best_vals), color = "silver")
				cent_1 = best_vals[1]

				x = mir_plot_x[::-1]
				y = self_intensity(mir_plot_x)
				init_vals = [max(y), est_peak_xval, 6]  # for [amp, cen, wid]
				best_vals, covar = curve_fit(gaussian, x, y, p0=init_vals)
				# ~ plt.plot(x, gaussian(x, *best_vals), color = "violet")
				cent_2 = best_vals[1]
				
				cent_mid = (cent_2 - cent_1)/2.0 ; 
				cent_diff = (cent_2 - cent_1) ; 
				cent_ave = (cent_2 + cent_1)/2.0 ; 
				print(cent_1, cent_2, cent_ave, cent_1 + cent_mid)
				
				
				# ~ mir_plot_x = np.arange(cent_ave-extend_lim, cent_ave+extend_lim + spec_resolution,  spec_resolution)
				
				
				# ~ plt.plot(mir_plot_x[::], self_intensity(mir_plot_x), color="r", marker = "")

				plt.plot([i - cent_diff for i in mir_plot_x[::-1]], self_intensity(mir_plot_x), color="violet", marker = "")


				# ~ mir_plot_x = np.arange(cent_2-extend_lim, cent_2+extend_lim + spec_resolution,  spec_resolution)
				
				
				# ~ plt.plot(mir_plot_x[::], self_intensity(mir_plot_x), color="r", marker = "")

				# ~ plt.plot([i for i in mir_plot_x[::-1]], self_intensity(mir_plot_x), color="orange", marker = "")




				
				# ~ plt.plot(x, gaussian(x, *new_vals), color = "violet")

				print(best_vals)




	# ~ if linelist_path == '': pass
	# ~ else:
		# ~ file_data = [i.strip("\n") for i in open(linelist_path)][3:]
		# ~ file_data = [[float(i[:11]), float(i[11:11+12]), i[11+12:].strip(" ")] for i in file_data]
		# ~ for line in file_data:
			# ~ plot=False
			# ~ if line[2] == 'pB': linestyle = "--" ; plot=True
			# ~ elif line[2] == '': linestyle = "--" ; plot=True
			# ~ else: linestyle = ":"

			# ~ wl_mm = line[0] * (2400/25.4)
			# ~ wl_mm = (wl_mm * 0.00821) + coeff_b  #plot to get on AA scale

			# ~ if plot == True:
				# ~ wls_to_match.append([line[0], wl_mm])
				# ~ #print(line[0], ", ", wl_mm, ",")
				# ~ plt.plot([wl_mm, wl_mm], [0 + y_shift,line[1] + y_shift], alpha = 0.3, color = linec, linestyle = linestyle)
