def plot_fe2(plot = True):
	a = [i for i in open("Ekb_Kur_Nave/fe2_subsec_forgrating.txt")][:]
	a = [i for i in a if i[0] != "#"]
	wns = [float(i[32:32+ 10]) for i in a]
	wls = [float(i[55:66]) for i in a]
	intensities = [float(i[:5]) for i in a]
	wls_unc = [float(i[68:79]) for i in a]
	notes = [i[202:209].strip(" ") for i in a]
	j=0 ; snr = 300
	fe2_line_wls_notB = []
	for wn_i, wn in enumerate(wls):
		if notes[wn_i][1:] == "" and notes[wn_i][0] != "S":
			if wn < 1240 and wls_unc[wn_i] < 5.1e-05 and intensities[wn_i] > 0.6:
			
				fe2_line_wls_notB.append(wn)
				if plot == True:
					snr = 300
					snr = 260* intensities[wn_i]/1.3
					if j== 0:
						plt.plot([wn, wn], [-10,snr], color = "k", alpha = 0.5, \
							label = "Fe II, Nave (no B)", linestyle = "--")
						j+=1
					else:
						plt.plot([wn, wn], [-10,snr], color = "k", alpha = 0.5, linestyle = "--")
	return np.array(fe2_line_wls_notB)


