def find_matches(wls_to_match, fe2_line_wls_notB,  all_wls, print_wout_match = False):
	potential_matches = []
	for dat in wls_to_match[:]:
		aspas_val = dat[0]
		estimate_AA = dat[1]
		closest_navefe2 = fe2_line_wls_notB.flat[np.abs(fe2_line_wls_notB - estimate_AA).argmin()]
		if abs(closest_navefe2 - estimate_AA) < 0.2:
			potential_matches.append(np.array([aspas_val, estimate_AA, closest_navefe2]))

	potential_matches = np.array(potential_matches)
	potential_navefe2 = potential_matches[:,2]
	#print(potential_matches)
	#print(potential_navefe2)
	i = 0 ; confirmed_matches = []
	while i < len(potential_navefe2):
		#print(i)
		#print(np.where(potential_navefe2 ==potential_navefe2[i]))
		#print(len(np.where(potential_navefe2 ==potential_navefe2[i])[0]))
		#print(potential_matches[np.where(potential_navefe2 ==potential_navefe2[i])[0]])
		asd = potential_matches[np.where(potential_navefe2 ==potential_navefe2[i])[0]]
		#print(np.abs(asd[:,1]- asd[:,2]))
		#print(np.abs(asd[:,1]- asd[:,2]).argmin())
		#print(asd[np.abs(asd[:,1]- asd[:,2]).argmin()])
		confirmed_matches.append(asd[np.abs(asd[:,1]- asd[:,2]).argmin()])
		
		i += len(np.where(potential_navefe2 ==potential_navefe2[i])[0])
	printing_data = [[i[0], i[-1]] for i in confirmed_matches]
	if print_wout_match == False: 
		for line in printing_data:
			print(" ".join([str(i) for i in line]))
	
	printing_data = np.array(printing_data)
	if print_wout_match == True: 
		for line in all_wls:
			if line[0] in printing_data[:,0]:
				printing_data_line = printing_data[np.where(printing_data[:,0] == line[0] )[0]][0]
				print(" ".join([str(i) for i in printing_data_line]))
			else: 
				print(line[0])
	
	
